import React from 'react'

const About = () => {
  return (
    <section className="section about-section">
      <h1 className="section-title">About us</h1>
      <p>Este es un proyecto de React con Next.js, que hago con la intención de practicar, y tomar impuslo para otros proyectos más complejos, que ayuden a conseguir mis objetivos.</p>
    </section>
  );
}

export default About
